import React from 'react';

interface Props {
  onClick: () => void;
  size: number;
}

const ProfileButton: React.FC<Props> = ({ onClick, size }) => {
  const style = {
    width: size,
    height: size,
    borderRadius: '50%',
    backgroundColor: 'blue',
    color: 'white',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    cursor: 'pointer'
  };

  return (
    <button style={style} onClick={onClick}>
      Click me!
    </button>
  );
};

export default CircleButton;
